    render() {
        // control the background style of the home page
        var url = URLs[randomNum];
        var styles = {
            backgroundColor: "#023000",
            backgroundImage: "url(" + url + ")",
            backgroundSize: "cover",
            backgroundrepeat: "no-repeat",
            backgroundPosition: "center",
            backgroundAttachment: "fixed",
            width: "100vw",
            height: "100vh"
        }
        return (
            <div className="App">
                <Background>
                    <div className="mainModal">
                        <Router>
                            <RoutedNav />
                        </Router>
                    </div>
                </Background>
            </div>
        )
    }
}

export default App;
